import React, { Component } from "react";
import { GridList, Container } from "@material-ui/core";

class Cart extends Component {
  render() {
    return (
      <div>
        <h2>Cart</h2>
        <GridList
          cellHeight={100}
          style={{ marginRight: 100, marginLeft: 100 }}
          cols={1}
        >
          {["red", "yellow"].map(color => (
            <Container
              style={{ background: color, justifyContent: "flex-start" }}
            >
              <img
                src="https://salt.tikicdn.com/cache/175x175/ts/product/9c/ad/e4/1efb61539a6adcf2da14bd70b21ddf58.jpg"
                alt={"Cart"}
              />
            </Container>
          ))}
        </GridList>
      </div>
    );
  }
}

export default Cart;
